script: |
  super -f text -I q9641.spq | sort > q9641.out

inputs:
  - name: q9641.spq
    data: |
      SELECT + cor0.col2 + - col2 * - cor0.col2 * col2 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NOT ( ( col0 - + col0 ) IN ( col0 * + col2 ) ) AND NOT ( NULL ) NOT IN ( + col2 * + col2 ) OR + col2 * - col1 BETWEEN NULL AND col2 + col1;
  - name: tab1

outputs:
  - name: q9641.out
    data: |
